import React from "react";
import styles from "./Home.css";
import image1 from "../../images/1.jpg";
import image2 from "../../images/2.jpg";
import image3 from "../../images/3.jpg";
import HomepageCarousel from "../general/HomepageCarousel";

const data = [
  { id: 1, image: image1 },
  { id: 2, image: image2 },
  { id: 3, image: image3 }
];

export default class Home extends React.Component {
  render() {
    return (
      <div className={styles.base}>
        <div className={styles.header}>{/* HeaderComponent */}</div>
        <div className={styles.topSection}>
          <div className={styles.opactityWrapper}></div>
          <div className={styles.slideshowContainer}>
            <HomepageCarousel>
              <div className={styles.mySlides}>
                <img src={image1} alt="" style={{ width: "100%" }}></img>
                <div className={styles.text}>Caption Text</div>
              </div>
            </HomepageCarousel>
            {/* <div className={styles.mySlides}>
              <img src="../../../images/2.jpg" style={{ width: "100%" }}></img>
              <div className={styles.text}>Caption Text</div>
            </div> */}
            {/* <div className={styles.mySlides}>
              <img src="../../../images/3.jpg" style={{ width: "100%" }}></img>
              <div className={styles.text}>Caption Text</div>
            </div> */}
          </div>
          <div className={styles.navButtonSection}>
            <div className={styles.navButton}>
              BUILD
              <br /> VISUAL PROFILE<div className={styles.innerTriangle}></div>
            </div>
            <div className={styles.navButton}>
              LOOK FOR
              <br /> APT GUIDANCE<div className={styles.innerTriangle}></div>
            </div>
            <div className={styles.navButton}>
              FIND
              <br /> INTERESTING EVENTS
              <div className={styles.innerTriangle}></div>
            </div>
            <div className={styles.navButton}>
              FEATURED
              <br /> STORIES<div className={styles.innerTriangle}></div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
